      <Grid centered >
        <Grid.Row>
          <Grid.Column>
            <PageHeader user={user} handleLogout={handleLogout}/>
          </Grid.Column>
        </Grid.Row>
        <Grid.Row>
          <Grid.Column style={{maxWidth: 450}}>
            <NoteFeed
              user={user} 
              numPhotosCol={1} 
              allNotes={allNotes}/>
          </Grid.Column>
        </Grid.Row>
    </Grid>
    )
}
